import React from "react";
import AnimatedSkillBlock from "./AnimatedSkillBlock";

const Languages = () => {
  return (
    <AnimatedSkillBlock index={0} bgColor="rgba(215, 192, 172, 0.4)">
      {" "}
      {/* Set a unique index for color */}
      <h3 className="skills_title">Languages</h3>
      <div className="skills_box">
        <div className="skills_group">
          {["HTML", "CSS", "JavaScript", "Java", "Python"].map((lang) => (
            <div className="skills_data" key={lang}>
              <i className="bx bx-badge-check"></i>
              <div>
                <h3 className="skills_name">{lang}</h3>
              </div>
            </div>
          ))}
        </div>
      </div>
    </AnimatedSkillBlock>
  );
};

export default Languages;
